this["JST"]["experience"] = Handlebars.template({"compiler":[6,">= 2.0.0-beta.1"],"main":function(depth0,helpers,partials,data) {
    return "<h1 class=\"subpage-heading\"><span>My experience</span></h1>\n\n<div class=\"body-text\">\n  <div class=\"container\">\n    <div class=\"par1\">\n      <i class=\"fa fa-github fa-5x wow bounceInRight\"></i>\n      <p>\n        I've been coding actively since May 2015\n        and my progress is extensively documented on Github,\n        from my first failed attempts at a calculator\n        to my final capstone project and beyond.\n      </p>\n    </div>\n  </div>\n\n  <div class=\"container\">\n    <div class=\"par3\">\n      <i class=\"fa fa-folder-open fa-5x wow bounceInLeft\"></i>\n      <p>\n          There are links to a few of my favorite projects on the main page\n          of my portfolio. Please dig through their commit histories and discover\n          all the steps to what made each project I've created.\n      </p>\n    </div>\n  </div>\n\n  <div class=\"container\">\n    <div class=\"par1\">\n      <i class=\"fa fa-globe fa-5x wow bounceInRight\"></i>\n      <p>\n        Before May, I led a nomadic lifestyle, <a href=\"http://hikehydratesleep.blogspot.com/\">hiking across Spain</a>,\n        living in Vietnam for a while, working in an multicultural office\n        and traveling a part of the globe I’d never seen before.\n      </p>\n    </div>\n  </div>\n\n  <div class=\"par3\">\n    <i class=\"fa fa-google fa-5x wow bounceInLeft\"></i>\n    <p>\n      I returned to Greenville, SC to build a life near family in the Blue Ridge\n      foothills, and am working as a line cook at a\n      <a href=\"http://swamprabbitcafe.com/\">grocery store</a> that supports local farmers\n      and the surrounding community.\n    </p>\n  </div>\n  <div class=\"par1\">\n    <i class=\"fa fa-newspaper-o fa-5x wow bounceInRight\"></i>\n    <p>\n      I’m a graduate of Louisiana State University with a degree in English\n      and a strong focus on journalism. Some of my older articles and opinion\n      columns can be found <a href=\"http://www.lsureveille.com/search/?t=article&s=start_time&sd=desc&d1=3+years+ago&q=megan+dunbar\">here</a>.\n    </p>\n  </div>\n  <div class=\"par3\">\n    <i class=\"fa fa-pencil-square-o fa-5x wow bounceInLeft\"></i>\n    <p>\n      I also attended an <a href=\"http://www.scgsah.org/\">arts-focused boarding school</a> where\n      I studied creative writing and began getting some poetry\n      and fiction works published.\n    </p>\n  </div>\n</div>\n";
},"useData":true});
