this["JST"]["index"] = Handlebars.template({"compiler":[6,">= 2.0.0-beta.1"],"main":function(depth0,helpers,partials,data) {
    return "<div class=\"cover\">\n  <h1 class=\"name\">Megan Dunbar</h1>\n</div>\n\n<div class=\"titles\">\n  <h3 class=\"first-title\">front-end developer</h3>\n  <h3 class=\"second-title\">freelance writer</h3>\n</div>\n\n<div class=\"body-text\">\n\n  <div class=\"par1\">\n    <i class=\"fa fa-laptop fa-5x wow bounceInRight\"></i>\n    <p>\n      I’m a graduate of\n      <a target=\"_blank\" href=\"http://theironyard.com/locations/greenville/\">The Iron Yard’s Greenville, SC campus</a>,\n        where I learned to build\n        <a target=\"_blank\" href=\"http://mldunbar.github.io/2.2-responsive/sushi.html\">responsive</a>,\n        <a target=\"_blank\" href=\"http://mldunbar.github.io/8.1-bookmarks/\">interactive</a>,\n        <a target=\"_blank\" href=\"http://mldunbar.github.io/bicycle-app-2/\">fully-functional</a> web apps.\n      </p>\n  </div>\n\n<div class=\"par3\">\n  <i class=\"fa fa-code-fork fa-5x wow bounceInLeft\"></i>\n  <p>\n    I used JavaScript with tools such as <a target=\"_blank\" href=\"#\">Handlebars</a>,\n    Bourbon, and Neat, add-ons like jQuery and underscore;\n    all within Ember.js and Backbone.js frameworks.\n  </p>\n</div>\n  <div class=\"par1\">\n    <i class=\"fa fa-server fa-5x wow bounceInRight\"></i>\n    <p>\n      I have a familiarity with Gulp, Bower, and Node.\n      And have also worked extensively with Parse\n      as a back-end server.\n    </p>\n  </div>\n<div class=\"par3\">\n  <i class=\"fa fa-picture-o fa-5x wow bounceInLeft\"></i>\n  <p>\n    When I’m not in front of my computer\n    <a href=\"https://www.codecademy.com/megdunbar\">playing with new languages</a>,\n    you can find me <a href=\"https://meganleedunbar.wordpress.com/\"> keeping up my blog</a>, hiking, and\n    <a href=\"https://www.youtube.com/watch?v=nVcBNBxjdas\">trying to play guitar</a>.\n  </p>\n</div>\n\n</div>\n";
},"useData":true});